  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:24.104791\",\n\t\"name\": \"san-luis-national-wildlife-refuge-merced-national-wildlife-refuge-kesterson-national-wi-31\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for San Luis
  NWR, Merced NWR, and Kesterson NWR outlines Refuge accomplishments during the 1970
  calendar year. The report begins by summarizing the weather conditions, habitat
  conditions, water conditions, and food and cover conditions during the year. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, mammals, raptors, fish, reptiles, and diseases- is also covered. The Refuge
  development and maintenance section discusses physical developments, plantings,
  vegetation control, and prescribed burning. Resource management is outlined; topics
  include grazing and fur harvesting. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, hunting, violations, and
  safety. Items of interest and N-R forms are attached.\",\n\t\"license_title\": \"License
